import * as pdfMake from "pdfmake";
import moment from "moment";

export const rockyValleyLogoBase64 = "data:image/png;base64,";

export function exportReceipt({customerName, cartItems, totalCost}) {
    const data = [];
    cartItems.forEach(cartItem => {
        data.push([cartItem.quantity, cartItem.name, {
            text: cartItem.trailTypeId,
            italics: true,
            color: "gray"
        }, cartItem.cost]);
    });

    const dd = {
        content: [
            {
                stack: [
                    {
                        image: rockyValleyLogoBase64,
                        width: 300
                    },
                    {text: "03 5754 1118", style: "subheader"},
                    {text: "info@rockyvalley.com.au", style: "subheader"},
                    {text: "226 Kiewa Valley Hwy, Tawonga South VIC 3698", style: "subheader"},
                ],
                style: "header"
            },

            {
                alignment: "justify",
                columns: [
                    {
                        text: `Customer: ${customerName}`,
                        style: "floatLeft",
                        fontSize: 16
                    },
                    {
                        text: `${moment().format("MM-DD-YYYY HH:mm:ss")}`,
                        style: "floatRight",
                        fontSize: 16
                    }
                ],
                margin: [0, 10, 0, 10]
            },
            {
                style: "tableExample",
                table: {
                    widths: [50, "*", 100, 70],
                    body: [
                        [
                            {text: "QTY", style: "tableHeader"},
                            {text: "DSC", style: "tableHeader"},
                            {text: "Trail Type", style: "tableHeader"},
                            {text: "AMT", style: "tableHeader"}
                        ],
                        ...data
                    ]
                }
            },
            {
                text: `Sum: $${totalCost}`,
                alignment: "right",
                margin: [0, 10, 0, 0],
                bold: true,
                fontSize: 20
            },
            {
                stack: [
                    {
                        text: "Rocky Valley",
                        italics: true,
                        color: "gray",
                        alignment: "right",
                        fontSize: 50,
                        margin: [0, 100, 0, 0]
                    },
                    {
                        text: `Melbourne, ${moment().format("MM-DD-YYYY HH:mm:ss")}`,
                        alignment: "right",
                        color: "gray",
                        fontSize: 20,
                        margin: [0, 10, 0, 0]
                    }
                ]
            }
        ],
        styles: {
            header: {
                fontSize: 30,
                bold: true,
                alignment: "center",
                margin: [0, 10, 0, 80]
            },
            subheader: {
                fontSize: 17
            },
            superMargin: {
                margin: [20, 0, 40, 0],
                fontSize: 15
            },
            floatLeft: {
                alignment: "left",
            },
            floatRight: {
                alignment: "right",
            },
            tableHeader: {
                fontSize: 18,
                bold: true
            }
        }
    };

    pdfMake.createPdf(dd).download();
}
